import React, { Component } from "react";

class Popup extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="menu">
        <div className="popup_inner text-center">
          <div className="overlay-content" />
        </div>
      </div>
    );
  }
}

export default Popup;
